import React from "react";
import "./dizainoDarbai.css";

const DizainoDarbai = () => {
  // Sample data for design works
  const designs = [
    {
      id: 1,
      imgSrc: "/nuotraukos/1.jpg", // Replace with your image paths
      title: "Design Work 1",
    },
    {
      id: 2,
      imgSrc: "/nuotraukos/2.jpg", // Replace with your image paths
      title: "Design Work 2",
    },
    {
      id: 3,
      imgSrc: "/nuotraukos/3.jpg", // Replace with your image paths
      title: "Design Work 3",
    },
    {
      id: 4,
      imgSrc: "/nuotraukos/4.jpg", // Replace with your image paths
      title: "Design Work 4",
    },
    {
      id: 5,
      imgSrc: "/nuotraukos/5.jpg", // Replace with your image paths
      title: "Design Work 5",
    },
    {
      id: 6,
      imgSrc: "/nuotraukos/6.jpg", // Replace with your image paths
      title: "Design Work 6",
    },
  ];

  return (
    <div className="dizaino-darbai-container">
      <h1>Grafinio Dizaino Darbai</h1>
      <div className="design-gallery">
        {designs.map((design) => (
          <div className="design-card" key={design.id}>
            <img
              src={design.imgSrc} // Correctly using imgSrc here
              alt={design.title}
              className="design-image"
            />
            <h2 className="design-title">{design.title}</h2>
          </div>
        ))}
      </div>
    </div>
  );
};

export default DizainoDarbai;
